/*Data for the table `jct_onet_occupation_list` */

insert  into `jct_onet_occupation_list`(`jct_onet_occupation_id`,`jct_onet_occupation_code`,`jct_onet_occupation_title`,`jct_onet_occupation_soft_delete`,`jct_onet_occupation_created_ts`,`jct_onet_occupation_created_by`,`jct_onet_occupation_description`) values (1111,'25-1194.00','Vocational Education Teachers, Postsecondary',0,'2016-05-30 12:28:38',NULL,'Teach or instruct vocational or occupational subjects at the postsecondary level (but at less than the baccalaureate) to students who have graduated or left high school. Includes correspondence school, industrial, and commercial instructors; and adult education teachers and instructors who prepare persons to operate industrial machinery and equipment and transportation and communications equipment. Teaching may take place in public or private schools whose primary business is education or in a school associated with an organization whose primary business is other than education.'),(1112,'13-2021.02','Appraisers, Real Estate',0,'2016-05-30 12:28:38',NULL,'Appraise real property to determine its value for purchase, sales, investment, mortgage, or loan purposes.'),(1113,'13-1074.00','Farm Labor Contractors',0,'2016-05-30 12:28:38',NULL,'Recruit and hire seasonal or temporary agricultural laborers. May transport, house, and provide meals for workers.'),(1114,'19-2043.00','Hydrologists',0,'2016-05-30 12:28:38',NULL,'Research the distribution, circulation, and physical properties of underground and surface waters; and study the form and intensity of precipitation, its rate of infiltration into the soil, movement through the earth, and its return to the ocean and atmosphere.'),(1115,'13-2021.01','Assessors',0,'2016-05-30 12:28:38',NULL,'Appraise real and personal property to determine its fair value. May assess taxes in accordance with prescribed schedules.'),(1116,'13-2021.00','Appraisers and Assessors of Real Estate',0,'2016-05-30 12:28:38',NULL,'Appraise real property and estimate its fair value. May assess taxes in accordance with prescribed schedules.'),(1117,'29-1024.00','Prosthodontists',0,'2016-05-30 12:28:38',NULL,'Construct oral prostheses to replace missing teeth and other oral structures to correct natural and acquired deformation of mouth and jaws, to restore and maintain oral function, such as chewing and speaking, and to improve appearance.'),(1118,'25-1124.00','Foreign Language and Literature Teachers, Postsecondary',0,'2016-05-30 12:28:38',NULL,'Teach languages and literature courses in languages other than English. Includes teachers of American Sign Language (ASL). Includes both teachers primarily engaged in teaching and those who do a combination of teaching and research.'),(1119,'13-1131.00','Fundraisers',0,'2016-05-30 12:28:38',NULL,'Organize activities to raise funds or otherwise solicit and gather monetary donations or other gifts for an organization. May design and produce promotional materials. May also raise awareness of the organization\'s work, goals, and financial needs.'),(1120,'25-1067.00','Sociology Teachers, Postsecondary',0,'2016-05-30 12:28:38',NULL,'Teach courses in sociology. Includes both teachers primarily engaged in teaching and those who do a combination of teaching and research.'),(1121,'19-4099.01','Quality Control Analysts',0,'2016-05-30 12:28:38',NULL,'Conduct tests to determine quality of raw materials, bulk intermediate and finished products. May conduct stability sample tests.'),(1122,'19-4099.02','Precision Agriculture Technicians',0,'2016-05-30 12:28:38',NULL,'Apply geospatial technologies, including geographic information systems (GIS) and Global Positioning System (GPS), to agricultural production or management activities, such as pest scouting, site-specific pesticide application, yield mapping, or variable-rate irrigation. May use computers to develop or analyze maps or remote sensing images to compare physical topography with data on soils, fertilizer, pests, or weather.'),(1123,'19-4099.00','Life, Physical, and Social Science Technicians, All Other',0,'2016-05-30 12:28:38',NULL,'All life, physical, and social science technicians not listed separately.'),(1124,'23-2099.00','Legal Support Workers, All Other',0,'2016-05-30 12:28:38',NULL,'All legal support workers not listed separately.'),(1125,'11-1021.00','General and Operations Managers',0,'2016-05-30 12:28:38',NULL,'Plan, direct, or coordinate the operations of public or private sector organizations. Duties and responsibilities include formulating policies, managing daily operations, and planning the use of materials and human resources, but are too diverse and general in nature to be classified in any one functional area of management or administration, such as personnel, purchasing, or administrative services.'),(1126,'21-2011.00','Clergy',0,'2016-05-30 12:28:38',NULL,'Conduct religious worship and perform other spiritual functions associated with beliefs and practices of religious faith or denomination. Provide spiritual and moral guidance and assistance to members.'),(1127,'25-1021.00','Computer Science Teachers, Postsecondary',0,'2016-05-30 12:28:38',NULL,'Teach courses in computer science. May specialize in a field of computer science, such as the design and function of computers or operations and research analysis. Includes both teachers primarily engaged in teaching and those who do a combination of teaching and research.'),(1128,'27-2022.00','Coaches and Scouts',0,'2016-05-30 12:28:38',NULL,'Instruct or coach groups or individuals in the fundamentals of sports. Demonstrate techniques and methods of participation. May evaluate athletes\' strengths and weaknesses as possible recruits or to improve the athletes\' technique to prepare them for competition. Those required to hold teaching degrees should be reported in the appropriate teaching category.'),(1129,'19-3094.00','Political Scientists',0,'2016-05-30 12:28:38',NULL,'Study the origin, development, and operation of political systems. May study topics, such as public opinion, political decision-making, and ideology. May analyze the structure and operation of governments, as well as various political entities. May conduct public opinion surveys, analyze election results, or analyze public documents.'),(1130,'25-1113.00','Social Work Teachers, Postsecondary',0,'2016-05-30 12:28:38',NULL,'Teach courses in social work. Includes both teachers primarily engaged in teaching and those who do a combination of teaching and research.'),(1131,'11-9071.00','Gaming Managers',0,'2016-05-30 12:28:38',NULL,'Plan, direct, or coordinate gaming operations in a casino. May formulate house rules.'),(1132,'17-2071.00','Electrical Engineers',0,'2016-05-30 12:28:38',NULL,'Research, design, develop, test, or supervise the manufacturing and installation of electrical equipment, components, or systems for commercial, industrial, military, or scientific use.'),(1133,'19-4099.03','Remote Sensing Technicians',0,'2016-05-30 12:28:38',NULL,'Apply remote sensing technologies to assist scientists in areas such as natural resources, urban planning, or homeland security. May prepare flight plans or sensor configurations for flight trips.'),(1134,'27-4031.00','Camera Operators, Television, Video, and Motion Picture',0,'2016-05-30 12:28:38',NULL,'Operate television, video, or motion picture camera to record images or scenes for various purposes, such as TV broadcasts, advertising, video production, or motion pictures.'),(1135,'25-1125.00','History Teachers, Postsecondary',0,'2016-05-30 12:28:38',NULL,'Teach courses in human history and historiography. Includes both teachers primarily engaged in teaching and those who do a combination of teaching and research.'),(1136,'11-3111.00','Compensation and Benefits Managers',0,'2016-05-30 12:28:38',NULL,'Plan, direct, or coordinate compensation and benefits activities of an organization.'),(1137,'15-2041.00','Statisticians',0,'2016-05-30 12:28:38',NULL,'Develop or apply mathematical or statistical theory and methods to collect, organize, interpret, and summarize numerical data to provide usable information. May specialize in fields such as bio-statistics, agricultural statistics, business statistics, or economic statistics. Includes mathematical and survey statisticians.'),(1138,'25-4013.00','Museum Technicians and Conservators',0,'2016-05-30 12:28:38',NULL,'Restore, maintain, or prepare objects in museum collections for storage, research, or exhibit. May work with specimens such as fossils, skeletal parts, or botanicals; or artifacts, textiles, or art. May identify and record objects or install and arrange them in exhibits. Includes book or document conservators.'),(1139,'15-2041.01','Biostatisticians',0,'2016-05-30 12:28:38',NULL,'Develop and apply biostatistical theory and methods to the study of life sciences.'),(1140,'15-2041.02','Clinical Data Managers',0,'2016-05-30 12:28:38',NULL,'Apply knowledge of health care and database management to analyze clinical data, and to identify and report trends.'),(1141,'27-2021.00','Athletes and Sports Competitors',0,'2016-05-30 12:28:38',NULL,'Compete in athletic events.'),(1142,'11-9151.00','Social and Community Service Managers',0,'2016-05-30 12:28:38',NULL,'Plan, direct, or coordinate the activities of a social service program or community outreach organization. Oversee the program or organization\'s budget and policies regarding participant involvement, program requirements, and benefits. Work may involve directing social workers, counselors, or probation officers.'),(1143,'11-9013.02','Farm and Ranch Managers',0,'2016-05-30 12:28:38',NULL,'Plan, direct, or coordinate the management or operation of farms, ranches, greenhouses, aquacultural operations, nurseries, timber tracts, or other agricultural establishments. May hire, train, or supervise farm workers or contract for services to carry out the day-to-day activities of the managed operation. May engage in or supervise planting, cultivating, harvesting, financial, or marketing activities.'),(1144,'27-4032.00','Film and Video Editors',0,'2016-05-30 12:28:38',NULL,'Edit moving images on film, video, or other media. May edit or synchronize soundtracks with images.'),(1145,'11-9013.03','Aquacultural Managers',0,'2016-05-30 12:28:38',NULL,'Direct and coordinate, through subordinate supervisory personnel, activities of workers engaged in fish hatchery production for corporations, cooperatives, or other owners.'),(1146,'11-9013.00','Farmers, Ranchers, and Other Agricultural Managers',0,'2016-05-30 12:28:38',NULL,'Plan, direct, or coordinate the management or operation of farms, ranches, greenhouses, aquacultural operations, nurseries, timber tracts, or other agricultural establishments. May hire, train, and supervise farm workers or contract for services to carry out the day-to-day activities of the managed operation. May engage in or supervise planting, cultivating, harvesting, and financial and marketing activities.'),(1147,'11-9013.01','Nursery and Greenhouse Managers',0,'2016-05-30 12:28:38',NULL,'Plan, organize, direct, control, and coordinate activities of workers engaged in propagating, cultivating, and harvesting horticultural specialties, such as trees, shrubs, flowers, mushrooms, and other plants.'),(1148,'25-1032.00','Engineering Teachers, Postsecondary',0,'2016-05-30 12:28:38',NULL,'Teach courses pertaining to the application of physical laws and principles of engineering for the development of machines, materials, instruments, processes, and services. Includes teachers of subjects such as chemical, civil, electrical, industrial, mechanical, mineral, and petroleum engineering. Includes both teachers primarily engaged in teaching and those who do a combination of teaching and research.'),(1149,'21-1029.00','Social Workers, All Other',0,'2016-05-30 12:28:38',NULL,'All social workers not listed separately.'),(1150,'13-1051.00','Cost Estimators',0,'2016-05-30 12:28:38',NULL,'Prepare cost estimates for product manufacturing, construction projects, or services to aid management in bidding on or determining price of product or service. May specialize according to particular service performed or type of product manufactured.'),(1151,'19-2032.00','Materials Scientists',0,'2016-05-30 12:28:38',NULL,'Research and study the structures and chemical properties of various natural and synthetic or composite materials, including metals, alloys, rubber, ceramics, semiconductors, polymers, and glass. Determine ways to strengthen or combine materials or develop new materials with new or specific properties for use in a variety of products and applications. Includes glass scientists, ceramic scientists, metallurgical scientists, and polymer scientists.'),(1152,'17-2161.00','Nuclear Engineers',0,'2016-05-30 12:28:38',NULL,'Conduct research on nuclear engineering projects or apply principles and theory of nuclear science to problems concerned with release, control, and use of nuclear energy and nuclear waste disposal.'),(1153,'19-2021.00','Atmospheric and Space Scientists',0,'2016-05-30 12:28:38',NULL,'Investigate atmospheric phenomena and interpret meteorological data, gathered by surface and air stations, satellites, and radar to prepare reports and forecasts for public and other uses. Includes weather analysts and forecasters whose functions require the detailed knowledge of meteorology.'),(1154,'29-1023.00','Orthodontists',0,'2016-05-30 12:28:38',NULL,'Examine, diagnose, and treat dental malocclusions and oral cavity anomalies. Design and fabricate appliances to realign teeth and jaws to produce and maintain normal function and to improve appearance.'),(1155,'27-1027.00','Set and Exhibit Designers',0,'2016-05-30 12:28:38',NULL,'Design special exhibits and movie, television, and theater sets. May study scripts, confer with directors, and conduct research to determine appropriate architectural styles.'),(1156,'25-2059.01','Adapted Physical Education Specialists',0,'2016-05-30 12:28:38',NULL,'Provide individualized physical education instruction or services to children, youth, or adults with exceptional physical needs due to gross motor developmental delays or other impairments.'),(1157,'21-1099.00','Community and Social Service Specialists, All Other',0,'2016-05-30 12:28:38',NULL,'All community and social service specialists not listed separately.'),(1158,'25-2059.00','Special Education Teachers, All Other',0,'2016-05-30 12:28:38',NULL,'All special education teachers not listed separately.'),(1159,'17-1021.00','Cartographers and Photogrammetrists',0,'2016-05-30 12:28:38',NULL,'Collect, analyze, and interpret geographic information provided by geodetic surveys, aerial photographs, and satellite data. Research, study, and prepare maps and other spatial data in digital or graphic form for legal, social, political, educational, and design purposes. May work with Geographic Information Systems (GIS). May design and evaluate algorithms, data structures, and user interfaces for GIS and mapping systems.'),(1160,'27-4099.00','Media and Communication Equipment Workers, All Other',0,'2016-05-30 12:28:38',NULL,'All media and communication equipment workers not listed separately.'),(1161,'25-4011.00','Archivists',0,'2016-05-30 12:28:38',NULL,'Appraise, edit, and direct safekeeping of permanent records and historically valuable documents. Participate in research activities based on archival materials.'),(1162,'19-2099.01','Remote Sensing Scientists and Technologists',0,'2016-05-30 12:28:38',NULL,'Apply remote sensing principles and methods to analyze data and solve problems in areas such as natural resource management, urban planning, or homeland security. May develop new sensor systems, analytical techniques, or new applications for existing systems.'),(1163,'19-3093.00','Historians',0,'2016-05-30 12:28:38',NULL,'Research, analyze, record, and interpret the past as recorded in sources, such as government and institutional records, newspapers and other periodicals, photographs, interviews, films, electronic me