  DECLARE l_jct_as_created_ts timestamp;                       
  DECLARE l_jct_as_lastmodified_ts timestamp  DEFAULT '0000-00-00 00:00:00';                                          
  DECLARE l_jct_as_lastmodified_by varchar(50);                                                                  
