  DECLARE l_jct_as_user_job_title varchar(30);                                                                   
  DECLARE l_jct_as_pageone_snapshot longblob;                                                                                 
  DECLARE l_jct_as_finalpage_snapshot longblob;                                                                               
  DECLARE l_jct_as_finalpage_initial_json_value mediumtext;                                                                   
